import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';

export default function App() {
  return (
    <div className="App">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p> 
        <h3>Parent Component
        </h3>          

    </div>
  );
}
ReactDOM.render(<App />,  document.getElementById('root'));
